(93, 'Strawberries 227G', 'Fruits', 'Product Description\r\nStrawberries\r\n\r\nStrawberries\r\nPack size: 227G\r\n\r\nIngredients\r\nStrawberry\r\n\r\nProduce of Egypt, Republic of Ireland, Netherlands#\r\n\r\nNumber of uses\r\n1 Servings\r\n', 1.69, 'strawberry-berry-levitating-white-background.jpg', 'Sam\'s Groceries', 'Roehampton', 0, 1.69, 14),
(94, 'Grapes 500G', 'Fruits', 'Product Description\r\nRed seedless grapes.\r\n\r\nHand Picked Carefully grown in vineyards for a juicy burst of refreshing sweetness..\r\n\r\nPack size: 0.5KG\r\n\r\nIngredients\r\nGrapes\r\n\r\nNumber of uses\r\n5 Servings', 1.80, 'Grape -3.jpg', 'Sam\'s Groceries', 'Roehampton', 0, 1.80, 14),
(95, 'Carrot Loose', 'Vegetables', 'Product Description\r\nCarrots.\r\n\r\nCarefully harvested and great eaten raw or roasted.\r\n\r\nIngredients\r\nCarrot\r\n\r\nProduce of Spain, France, Israel\r\n\r\nNumber of uses\r\n1 Servings', 0.10, 'baby-carrots.jpg', 'Sam\'s Groceries', 'Roehampton', 0, 0.10, 14),
(96, 'Onion Loose', 'Vegetables', 'Product Description\r\nBrown onions\r\n\r\nGreat in soups, stews, stir fry\'s or even a salad. Delicious Caramelised.\r\nPacks flavour into any meal\r\n\r\nIngredients\r\nOnion\r\n\r\nProduce of United Kingdom, Spain, Egypt, New Zealand, Chile\r\n\r\nNumber of uses\r\n2 Servings', 0.12, 'raw-onions-white-surface.jpg', 'Sam\'s Groceries', 'Roehampton', 0, 0.12, 14),
(97, 'Whole Cucumber', 'Vegetables', 'Product Description\r\nCucumber\r\n\r\nHand picked Carefully selected to be cool, crisp and refreshing\r\n\r\nIngredients\r\nCucumber\r\n\r\nProduce of\r\nProduce of United Kingdom, Canary Islands, Greece, Morocco, Netherlands, Spain\r\n\r\nNumber of uses\r\n4 Servings\r\n\r\nNet Contents\r\n1', 0.89, 'green-cucumber.jpg', 'Sam\'s Groceries', 'Roehampton', 0, 0.89, 14),
(100, 'Mowi 4 Salmon Fillets', 'Meat', 'Product Description\r\n4 Fresh Scottish Salmon Fillets\r\nMowi is also the first Scottish Salmon brand to be ASC approved - an independent certification of responsible farming to a new high standard.\r\n\r\nFor more information and recipes, go to www.mowisalmon.co.uk\r\n\r\nMake salmon part of a varied and healthy diet and lifestyle.\r\nHigh in omega 3: Each portion typically has 2190mg of which more than half (1130mg) are DHA and EPA. Eating 250mg of EPA and DHA omega 3 fatty acids daily contributes to the n', 10.00, 'salmon.PNG', 'Sam\'s Groceries', 'Roehampton', 20, 8.00, 14),
(101, '2 Chicken Breast', 'Meat', 'Product Description\r\nFresh Class A skinless chicken breast fillets.\r\n\r\nTesco Welfare Approved Fed on a wholegrain diet for a succulent texture\r\n\r\nPack size: 300G\r\nIngredients\r\n\r\nINGREDIENTS: Chicken Breast Fillet.\r\n\r\nProduce of\r\nProduced in the U.K., Origin UK\r\n\r\nNumber of uses\r\n2 Servings\r\n\r\nNet Contents\r\n300g e', 2.35, 'chickenbreast.PNG', 'Sam\'s Groceries', 'Roehampton', 0, 2.35, 14),
(102, 'Bananas Loose', 'Fruits', 'Product Description\r\nBanana.\r\n\r\nResponsibly Grown. Hand picked and gently ripened with a sweet flavour.\r\n\r\nIngredients\r\nBanana\r\n\r\nProduce of Cameroon, Colombia, Costa Rica, Ecuador, Guatemala, Ivory Coast (Côte d\'Ivoire)\r\n\r\nNumber of uses\r\n1 Servings', 0.15, 'banana.jpg', 'Sam\'s Groceries', 'Roehampton', 0, 0.15, 14),
(103, 'Fanta Orange Zero 2L', 'Drinks', 'Product Description\r\nSparkling Low Calorie Orange Fruit Drink with Sweeteners\r\nLiven up any occasion with this tongue tingling, fruity orange drink with zero sugar.\r\n\r\nFanta Zero&#39;s cool taste is made with…\r\n- Real fruit\r\n- Natural flavours\r\n- No artificial colours\r\n- No added sugar\r\nServe ice cold for maximum refreshment.\r\n\r\nContains 8 x 250ml servings.\r\nKeep cold in the fridge.\r\n\r\nPlease recycle.', 2.00, 'fanta.PNG', 'Sam\'s Groceries', 'Roehampton', 0, 2.00, 14),
(104, 'Coca Cola 15x330ml', 'Drinks', 'Product Description\r\nSparkling Low Calorie Soft Drink with Vegetable Extracts with Sweeteners\r\n\r\nCoca-Cola Zero Sugar is the perfect drink for people who want all the taste of Coca‑Cola, without the sugar or calories.\r\nZero sugar\r\nZero Calories\r\nContains vegetable extracts and sweeteners\r\nGluten-free, dairy-free and nut-free\r\nServe ice cold for maximum refreshment.\r\nKeep one cold in the fridge\r\nPlease recycle.\r\n\r\nIngredients\r\nCarbonated Water, Colour (Caramel E150d), Phosphoric Acid, Sweeteners ', 7.90, 'Coca cola.PNG', 'Sam\'s Groceries', 'Roehampton', 10, 7.11, 14),
(105, 'Kingsmill 50/50 Bread', 'Bread', 'Soft White Bread made with 50% Wholemeal Wheat Flour (33% of the baked loaf)\r\n50% of your daily whole grain in 2 slices**\r\n**based on US Dietary Guidelines of 48g of whole grain a day\r\n\r\n® &#34;Kingsmill&#34; and &#34;50/50&#34; are Registered Trade Marks of ABF Grain Products Ltd.\r\n\r\nSuitable for Vegetarians and Vegans\r\nKosher - SKA\r\nHalal\r\nPack size: 800G\r\n\r\nIngredients\r\nWheat Flour (33%) (with Calcium, Iron, Niacin (B3) and Thiamin (B1)), Wholemeal Wheat Flour (33%), Water, Yeast, Salt, Veget', 1.30, 'bread.PNG', 'Sam\'s Groceries', 'Roehampton', 0, 1.30, 14),
(106, 'Hovis SoftWhite Bread ', 'Bread', 'Product Description\r\nSoft white medium sliced white bread 800G\r\nAt Hovis®, our expert bakers have been baking bread for 130 years, so they&#39;ve learnt a thing or two about making a great loaf.\r\n\r\nMade by Hovis Ltd. Designs and trademarks appearing on pack are owned by Hovis Ltd.\r\n\r\nSoft to The Last Slice\r\nSuitable for Vegetarians & Vegans\r\nKosher - KLBD\r\nPack size: 800G\r\n\r\nIngredients\r\nWheat Flour (with added Calcium, Iron, Niacin, Thiamin), Water, Yeast, Salt, Soya Flour, Preservative: E282, ', 1.39, 'hovisbread.PNG', 'Sam\'s Groceries', 'Roehampton', 0, 1.39, 14),
(107, 'Snickers Bars', 'Snacks', 'Product Description\r\nMilk chocolate (35%) with soft nougat (14%) and caramel centre (28%) with peanuts (22%).\r\n\r\n100% Responsibly Sourced Cocoa*\r\n*100% verified as responsibly sourced cocoa. We purchase a volume of responsibly sourced cocoa equivalent to the volume used in this product. Learn more at www.mars.com/COCOA-EUROPE\r\n\r\nFree from Artificial Colours, Flavours & Preservatives\r\nSuitable for vegetarians\r\n\r\nPack size: 166.8G\r\n\r\nIngredients\r\nSugar, Glucose Syrup, Peanuts, Skimmed Milk Powder,', 1.69, 'snickers.PNG', 'Sam\'s Groceries', 'Roehampton', 10, 1.52, 14),
(108, 'Bounty Ice Cream', 'Snacks', 'Product Description\r\nCoconut dairy ice cream with a cocoa coating (34%) dotted with crispy coconut biscuits (1.8%).\r\n\r\nSuitable for vegetarians\r\nPack size: 200.4ML\r\n\r\nIngredients\r\nSkimmed Milk (20%), Sugar, Cream (from Milk), Glucose Syrup, Water, Coconut (5.5%) (Desiccated Coconut, Coconut Milk Powder), Cocoa Butter, Coconut Fat, Cocoa Mass, Skimmed Milk Powder, Palm Fat, Sweetened Condensed Skimmed Milk, Coconut Biscuits (1.8%) (Sugar, Coconut Flakes (25%), Wheat Starch, Wheat Flour, Milk Prot', 2.50, 'bounty.PNG', 'Snackies', 'Roehampton', 10, 2.25, 15),
(109, 'Walkers Ready Salted', 'Snacks', 'Ready Salted Potato Crisps\r\n- Multipack of Walkers Ready Salted crisps\r\n- Made with 100% Great British Potatoes\r\n- Fresh taste guaranteed\r\n- Perfect crisps for lunch and snacking\r\n- Multipack contains 12 bags of crisps\r\n- Suitable for vegetarians\r\n- No added MSG, Artificial Colours\r\n\r\nWhen you look at a potato, what do you see? Probably just a potato, right? Well, in 1948 Henry Walker saw potential with a bite of positivity he turned his humble spuds into irresistible Walkers Crisps. Since then,', 3.00, 'crisps.PNG', 'Snackies', 'Roehampton', 0, 3.00, 15),
(110, 'Nissin Ramen Noodles', 'Snacks', 'Product Description\r\nSoup with Instant Noodles Asian Style, Chicken Flavour.\r\nLicensed by: Nissin Foods Holdings Co., Ltd. Japan\r\n\r\nPack size: 100G\r\nIngredients\r\nNoodles 91, 5% [Wheat Flour, Palm Oil, Salt, Flour Treatment Agents (Sodium Carbonate, Triphosphates), Stabiliser (Potassium Carbonate), Thickener (Guar Gum), Antioxidant (Tocopherol-Rich Extract)], Seasoning Powder 7, 3% [Salt, Flavour Enhancers (Monosodium Glutamate, Disodium Guanylate, Disodium Inosinate), Sugar, Chicken Meat Powder ', 0.65, 'Noodle.PNG', 'CMart', 'Croydon', 0, 0.65, 16),
(111, 'Lotte Milkis 250ml', 'Drinks', 'Korea\'s beloved milk and youghurt flavoured sparkling drink. \r\n\r\nSimilar in taste to the well-known Calpis (Calpico in the UK), Milkis is one of the most popular drinks in Korea and combines the traditional fizz and sweetness of traditional sparkling soda with the creamy taste of milk and slight tang of yogurt. Labelled as the \"New Feeling of Soda Beverage,\" give your tongue a treat and swim into the world of Milkis. \r\n\r\nWater, Fructose, Sugar, Skim Milk Powder, Acidity Regulator(E290), Food Aci', 1.35, 'Milkis.PNG', 'CMart', 'Croydon', 0, 1.35, 16),
(112, 'Preserved Peel', 'Fruits', 'JB Preserved Mandarin Peel\r\nSweetened and spiced preserved mandarin peel. Makes a great snack for travelling.\r\n\r\nIngredients\r\nMandarin Peel 90%, Sugar, Salt, Acidity Regulator E330, Spices, Liquorice, Sweetener (E951 Contains A Source Of Phenylalanine, E952, E954), Preservatices (E202, E211)', 0.95, 'mango.PNG', 'CMart', 'Croydon', 0, 0.95, 16),
(114, 'Hong Bubble Tea', 'Drinks', 'Ingredients\r\nWater, Apple Juice From Concentrate: 20% Bursting Bubble: 6% (Water, Fructose, Apple Juice From Concentrate: 6% Acidity Regulator: Calcium Lactate, Thickeners: Xanthan Gum, Acetylated Starch, Sodium Alginate, Perservative: Malic Acid, Antitoxidant: Absorbic Acid, Sweetener: Sucralose.', 1.95, 'bubble tea.PNG', 'CMart', 'Croydon', 0, 1.95, 16),
(115, 'Eastman&#39;s Pork Meat', 'Meat', 'Product Description\r\nSliced, cured and cooked reformed pork with added water and spices.\r\nProper Tasty 20 Slices\r\nPack size: 250G\r\n\r\nIngredients\r\nINGREDIENTS: Pork (79%), Water, Pea Starch, Salt, Stabilisers (Tetrapotassium Diphosphate, Disodium Diphosphate, Pentasodium Triphosphate, Potassium Triphosphate), Honey, Mineral Sea Salt, Dextrose, White Pepper, Brown Sugar, Nutmeg, Antioxidant (Sodium Ascorbate), Gluten Free Breadcrumbs [Rice Flour, Cornflour, Rapeseed Oil, Salt, Colours (Curcumin, P', 1.00, 'ham.PNG', 'SPAR', 'Croydon', 0, 1.00, 17),
(116, 'Semi Skimmed Milk', 'Drinks', 'Product Description\r\nPasteurised homogenised semi skimmed milk.\r\n\r\nMilk from British Farms\r\nPack size: 2.272L\r\n\r\nProduced in the U.K., using milk from the U.K.\r\n\r\nNumber of uses\r\napprox. 11 Servings\r\n\r\nNet Contents\r\n2.272L e 4 Pints', 1.45, 'Milk.PNG', 'SPAR', 'Croydon', 0, 1.45, 17),
(119, 'Milk', 'Drinks', 'milk', 1.25, 'Milk.PNG', 'Munchies', 'Roehampton', 0, 1.25, 18);
